import React from "react";
// import Navbar from "../components/Navbar";
import styles from './Community.module.css';

export default function Community(){
    return  (
    <div>
        {/* <Navbar /> */}
        <div className={styles.grid_container}>
            <div className={styles.profile_icon}>1</div>
            <div style={{backgroundColor: "blue"}}>2</div>
            <div className={styles.profile_icon}>3</div>
            <div className={styles.profile_icon}>4</div>
            <div className={styles.profile_icon}>5</div>
            <div className={styles.profile_icon}>6</div>
            <div className={styles.profile_icon}>7</div>
            <div className={styles.profile_icon}>8</div>
            <div className={styles.profile_icon}>9</div>
            <div className={styles.profile_icon}>10</div>
            <div className={styles.profile_icon}>11</div>
            <div className={styles.profile_icon}>12</div>
            <div className={styles.profile_icon}>13</div>
            <div className={styles.profile_icon}>14</div>
            <div className={styles.profile_icon}>15</div>
            <div className={styles.profile_icon}>16</div>
            <div className={styles.profile_icon}>17</div>
            <div className={styles.profile_icon}>18</div>
            <div className={styles.profile_icon}>19</div>
            <div className={styles.profile_icon}>20</div>
        </div>
    </div>
    );
}
